import { Col, Container } from "react-bootstrap";
import "./Kush.css";
export const ProjectDetailed = ({ title, description, deadline, participants, imgUrl }) => {
  return (
    <div class="info-container">
        <h1 class="info-heading">Heading</h1>
        <p class="info-description">This is a left-aligned div with a heading and description. The heading and description are styled using CSS.</p>
        <div className="proj-detailed-name"> <p>{title} </p></div>
        <div className="proj-detailed-text"> <p>{description} </p></div>
        <div className="proj-detailed-deadline"> <p>{deadline} </p></div>
        <div className="proj-detailed-participants"> <p>{participants} </p></div>
    </div>
  )
}
